import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import './cv.css';
import CardMedia from '@material-ui/core/CardMedia';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import Card from '@material-ui/core/Card';



const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    backgroundColor:"#262626",
    paddingLeft: "2rem",
    paddingRight: "2rem",
    marginBottom: "4rem",
    
  },
  paper: {
    
    textAlign: 'center',
    color: "#fff",
    fontSize: "38px",
    fontWeight: "600",
    
  },
  content: {
    maxWidth: 765,
  },
}));

export default function FullWidthGrid() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Grid container spacing={10}>
        <Grid item xs={12}>
        <Typography variant="h2" color="" className={classes.paper} component="h1">
          2013
          </Typography>
          
        </Grid>
        
        <Grid item xs={12} sm={6} md={6} className={classes.content}>
          
          <div className="col1 container textpara boxes">
          
          <CardContent>
          
          <Typography variant="body2" color="" component="p">
            Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging
            across all continents except Antarctica
            across all continents except Antarctica
            across all continents except Antarctica
          </Typography>
        </CardContent>
        </div>
            
            
            
        </Grid>
        <Grid item xs={12} sm={6} md={6} className={classes.content}>
          <div className="container card1">
          
          <CardMedia
        className={classes.imgs}
          component="img"
          alt="Contemplative Reptile"
          height="290"
          
          image={process.env.PUBLIC_URL+"react.png"}
          
        />
</div>

        </Grid>
        
        </Grid>
    </div>
  );
}
